import React, { Component } from "react";
import { Tabs, Tab } from "react-mdl";
class Home extends Component {
  state = {
    activetab: 0
  };
  render() {
    return (
      <div>
        <Tabs>
          <Tab>React</Tab>
        </Tabs>
      </div>
    );
  }
}

export default Home;
